import React from 'react';
import "./Dashboard.css";
import SensorChart from './SensorChart.tsx';

function Dashboard() {
  return (
    <div className="dashboard">
      <div className="main-content">
        <div className="chart-container">
          <SensorChart />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
